def filterRestaurants(restaurants, veganFriendly, maxPrice, maxDistance):
    dic={}
    for val in restaurants:
        dic[val[1]]=[]
    for val in restaurants:
        if val[2]>=veganFriendly and val[3]<=maxPrice and val[4]<=maxDistance:
            dic[val[1]].append(val[0])
    ans=[]
    for key in sorted(dic.keys(),reverse=True):
        ans.extend(reversed(dic[key]))
    return ans

